create database omc DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
use omc;
SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for oam_alarm_active
-- ----------------------------
DROP TABLE IF EXISTS `oam_alarm_active`;
CREATE TABLE `oam_alarm_active` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `alarm_id` varchar(400) DEFAULT '' COMMENT '告警id',
  `ne_id` text COMMENT '网元Id',
  `ne_name` text COMMENT '网元名称',
  `alarm_name` varchar(64) DEFAULT NULL COMMENT '告警名称',
  `alarm_type` smallint(6) DEFAULT NULL COMMENT '告警类型',
  `alarm_level` smallint(6) DEFAULT NULL COMMENT '告警级别',
  `alarm_status_type` smallint(6) DEFAULT NULL COMMENT '告警状态类型',
  `alarm_event_time` datetime DEFAULT NULL COMMENT '告警产生时间',
  `alarm_cleared_time` datetime DEFAULT NULL COMMENT '告警清除时间',
  `alarm_cleared_type` smallint(6) DEFAULT NULL COMMENT '告警清除类型',
  `alarm_object` text COMMENT '告警对象',
  `alarm_location_info` text COMMENT '告警定位信息',
  `alarm_pv_flag` smallint(6) DEFAULT NULL COMMENT '网元虚拟化标识',
  `alarm_detail` text COMMENT '告警详细信息',
  `specific_problem_id` varchar(128) DEFAULT NULL COMMENT '告警问题原因ID',
  `specific_problem` text,
  `ne_type` varchar(64) DEFAULT NULL COMMENT '告警网元设备类型',
  `alarm_object_uid` text COMMENT '告警定位对象UID',
  `alarm_object_name` text COMMENT '告警定位对象名称',
  `alarm_object_type` varchar(64) DEFAULT NULL COMMENT '告警定位对象资源类型',
  `alarm_add_info` text COMMENT '告警辅助信息',
  `alarm_event_title` varchar(64) DEFAULT NULL COMMENT '告警事件标题',
  `province` varchar(64) DEFAULT NULL COMMENT '网元服务省份',
  `alarm_confirm_time` datetime DEFAULT NULL COMMENT '告警确认时间',
  `ack_state` smallint(6) DEFAULT '0' COMMENT '告警确认状态',
  `alarm_confirm_userid` varchar(64) DEFAULT NULL COMMENT '告警确认用户ID',
  `alarm_confirm_username` varchar(64) DEFAULT NULL COMMENT '告警确认用户名称',
  `alarm_device_type` varchar(64) DEFAULT NULL COMMENT '告警设备类型',
  `rm_uid` varchar(64) DEFAULT NULL COMMENT '告警网元UID',
  `ne_uname` varchar(64) DEFAULT NULL COMMENT '告警网元名称',
  `merge_flag` smallint(6) DEFAULT '0' COMMENT '告警是否已经合并清除',
  `sync_type` smallint(6) DEFAULT '0' COMMENT '同步告警的类型',
  `alarm_storage_time` datetime DEFAULT NULL COMMENT '告警入库时间',
  `off_line` smallint(6) DEFAULT NULL COMMENT '告警所在是否下线标识',
  `alarm_no` text COMMENT '告警编号',
  `source` varchar(50) DEFAULT '' COMMENT '来源',
  `developer_id` varchar(32) DEFAULT NULL COMMENT '开发者Id',
  `product_key` varchar(64) DEFAULT NULL COMMENT '产品Id',
  `domain_id` int(11) DEFAULT NULL COMMENT '域ID',
  `domain_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '域名称',
  `project_id` varchar(255) DEFAULT NULL COMMENT '项目ID',
  `project_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '项目名称',
  `created_by` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人',
  `updated_by` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '更新人',
  `updated_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `group_id` varchar(32) DEFAULT NULL COMMENT '分组id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=23497 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oam_alarm_active
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_alarm_history
-- ----------------------------
DROP TABLE IF EXISTS `oam_alarm_history`;
CREATE TABLE `oam_alarm_history` (
  `id` bigint(64) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `alarm_id` varchar(400) DEFAULT NULL COMMENT '告警id',
  `ne_id` varchar(100) DEFAULT NULL COMMENT '网元Id',
  `ne_name` varchar(200) DEFAULT NULL COMMENT '网元名称',
  `alarm_object_uid` text COMMENT '设备id',
  `alarm_object_name` text COMMENT '设备名称',
  `alarm_name` varchar(256) DEFAULT NULL COMMENT '告警名称',
  `alarm_type` smallint(20) DEFAULT NULL COMMENT '告警类型',
  `alarm_level` smallint(20) DEFAULT NULL COMMENT '告警级别',
  `alarm_status_type` smallint(20) DEFAULT NULL COMMENT '告警状态类型',
  `alarm_event_time` datetime DEFAULT NULL COMMENT '告警产生时间',
  `alarm_cleared_time` datetime DEFAULT NULL COMMENT '告警清除时间',
  `alarm_cleared_type` smallint(20) DEFAULT NULL COMMENT '告警清除类型',
  `alarm_device_type` varchar(64) DEFAULT NULL COMMENT '告警设备类型(网关、设备、平台)',
  `rm_uid` varchar(64) DEFAULT NULL COMMENT '告警网元UID',
  `alarm_location_info` text COMMENT '告警定位信息',
  `alarm_pv_flag` smallint(6) DEFAULT NULL COMMENT '网元虚拟化标识',
  `alarm_detail` text COMMENT '告警详细信息',
  `specific_problem_id` varchar(128) DEFAULT NULL COMMENT '告警问题原因ID',
  `specific_problem` text,
  `ne_type` varchar(64) DEFAULT NULL COMMENT '告警网元设备类型',
  `alarm_object_type` varchar(64) DEFAULT NULL COMMENT '告警定位对象资源类型',
  `sync_type` smallint(6) DEFAULT '0' COMMENT '同步告警的类型',
  `alarm_add_info` text COMMENT '告警辅助信息',
  `alarm_event_title` varchar(512) DEFAULT NULL COMMENT '告警事件标题',
  `province` varchar(64) DEFAULT NULL COMMENT '网元服务省份',
  `alarm_confirm_time` datetime DEFAULT NULL COMMENT '告警确认时间',
  `ack_state` varchar(64) DEFAULT NULL COMMENT '告警确认状态',
  `alarm_confirm_userid` bigint(20) DEFAULT NULL COMMENT '告警确认用户ID',
  `alarm_confirm_username` varchar(64) DEFAULT NULL COMMENT '告警确认用户名称',
  `merge_flag` smallint(20) DEFAULT '0' COMMENT '告警是否已经合并清除',
  `alarm_storage_time` datetime DEFAULT NULL COMMENT '告警入库时间',
  `developer_id` varchar(64) DEFAULT NULL COMMENT '租户id',
  `product_key` varchar(64) DEFAULT NULL COMMENT '产品Id',
  `domain_id` int(11) DEFAULT NULL COMMENT '域ID',
  `domain_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '域名称',
  `project_id` varchar(64) DEFAULT NULL COMMENT '项目ID',
  `project_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '项目名称',
  `created_by` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人',
  `updated_by` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '更新人',
  `updated_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `group_id` varchar(32) DEFAULT NULL COMMENT '分组id',
  `off_line` smallint(6) DEFAULT NULL COMMENT '告警所在是否下线标识',
  `alarm_no` text COMMENT '告警编号',
  `source` varchar(50) DEFAULT NULL COMMENT '来源',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oam_alarm_history
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_subscribe
-- ----------------------------
DROP TABLE IF EXISTS `oam_subscribe`;
CREATE TABLE `oam_subscribe` (
  `ne_id` varchar(255) DEFAULT NULL COMMENT '网元实例id',
  `data_type` varchar(255) DEFAULT NULL COMMENT '数据类型:register,alarm,perf',
  `callback_url` varchar(255) DEFAULT NULL COMMENT '回调URL',
  `system_id` varchar(255) NOT NULL COMMENT '上层网管ID'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oam_subscribe
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_system
-- ----------------------------
DROP TABLE IF EXISTS `oam_system`;
CREATE TABLE `oam_system` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `system_id` varchar(255) DEFAULT NULL,
  `system_name` varchar(255) DEFAULT NULL,
  `system_ip` varchar(255) DEFAULT NULL,
  `system_port` varchar(255) DEFAULT NULL,
  `user` varchar(255) NOT NULL,
  `password` varchar(255) DEFAULT NULL,
  `alarm_offset` int(10) DEFAULT '-1' COMMENT '偏移量一经初始化，就不应再变动。新增用户初始值一定要为-1，谢谢',
  `alarm_sent_quantity` int(10) DEFAULT '0' COMMENT '已发送的告警数，初始值为0',
  `sent_max_id` int(10) DEFAULT '-1',
  `login_mode` varchar(20) DEFAULT NULL COMMENT '登陆方式，值为 pwd或cmca',
  `oss_description` varchar(255) DEFAULT NULL COMMENT '描述',
  `oss_pass_key` varchar(255) DEFAULT NULL COMMENT '密钥',
  PRIMARY KEY (`user`,`id`) USING BTREE,
  KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oam_system
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_users
-- ----------------------------
DROP TABLE IF EXISTS `oam_users`;
CREATE TABLE `oam_users` (
  `user_id` varchar(60) NOT NULL DEFAULT '' COMMENT '上层网管登录ID',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '上层网管登录密码',
  `system_id` varchar(50) NOT NULL DEFAULT '' COMMENT '上层网管系统ID',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oam_users
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_vnf
-- ----------------------------
DROP TABLE IF EXISTS `oam_vnf`;
CREATE TABLE `oam_vnf` (
  `ne_id` varchar(255) NOT NULL COMMENT '网元实例id',
  `ne_type` varchar(255) DEFAULT NULL COMMENT '网元类型',
  `vnf_name` varchar(255) DEFAULT NULL COMMENT '网元名称',
  `vnf_manage_ip` varchar(255) DEFAULT NULL COMMENT '管理ip',
  `vnf_manage_port` varchar(255) DEFAULT NULL COMMENT '管理端口',
  `vnf_signal_port` varchar(255) DEFAULT NULL COMMENT '信令跟踪端口',
  `vnf_status` varchar(255) DEFAULT NULL COMMENT '在线1/下线3',
  `vnf_manage_status` varchar(255) DEFAULT NULL COMMENT '纳管1/脱管0',
  `heart_beat_time` datetime DEFAULT NULL COMMENT '网元心跳上报时间点',
  `system_id` varchar(255) DEFAULT NULL COMMENT '上层网管ID',
  `conf_status` varchar(255) DEFAULT NULL COMMENT '0|已下载配置,1|未下载配置',
  PRIMARY KEY (`ne_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oam_vnf
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_vnf_config_file
-- ----------------------------
DROP TABLE IF EXISTS `oam_vnf_config_file`;
CREATE TABLE `oam_vnf_config_file` (
  `ne_id` varchar(255) DEFAULT NULL COMMENT '网元实例ID',
  `ne_type` varchar(255) DEFAULT NULL COMMENT '网元类型',
  `cf_version` varchar(255) DEFAULT NULL COMMENT '配置版本号，OAM自己维护',
  `cf_path` varchar(255) DEFAULT NULL COMMENT '配置文件路径',
  `cf_name` varchar(255) DEFAULT NULL COMMENT '配置文件名称',
  `cf_size` varchar(255) DEFAULT NULL COMMENT '配置文件大小,单位(MB)',
  `cf_updatetime` timestamp NULL DEFAULT NULL COMMENT '配置更新时间',
  `is_use` tinyint(1) DEFAULT NULL COMMENT '是否当前版本',
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '物理主键',
  `file_content` text COMMENT '文件内容',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oam_vnf_config_file
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for oam_vnf_config_task
-- ----------------------------
DROP TABLE IF EXISTS `oam_vnf_config_task`;
CREATE TABLE `oam_vnf_config_task` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务ID',
  `ne_type` varchar(255) DEFAULT NULL COMMENT '网元类型',
  `ne_id` varchar(255) DEFAULT NULL COMMENT '网元实例ID',
  `vnf_name` varchar(255) DEFAULT NULL COMMENT '网元名称',
  `vnf_manage_ip` varchar(255) DEFAULT NULL COMMENT '网元IP',
  `vnf_signal_port` varchar(255) DEFAULT NULL COMMENT '网元端口',
  `status` varchar(255) DEFAULT NULL COMMENT '状态：未执行、已完成、执行中',
  `callback_url` varchar(255) DEFAULT NULL COMMENT '上层系统接收地址',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `type` varchar(255) DEFAULT NULL COMMENT '任务类型 :下发配置|切换历史版本配置',
  `version` varchar(255) DEFAULT NULL COMMENT '任务中文件版本',
  PRIMARY KEY (`task_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oam_vnf_config_task
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for omc_pm_indicator
-- ----------------------------
DROP TABLE IF EXISTS `omc_pm_indicator`;
CREATE TABLE `omc_pm_indicator` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '指标主键',
  `counter_id` varchar(64) NOT NULL COMMENT '指标编号',
  `ne_type` varchar(32) NOT NULL DEFAULT 'UPF',
  `cn_name` varchar(64) NOT NULL COMMENT '指标中文名',
  `en_name` varchar(64) NOT NULL COMMENT '指标英文名',
  `data_type` varchar(32) DEFAULT NULL COMMENT '数据类型',
  `unit` varchar(64) DEFAULT NULL COMMENT '单位',
  `stat_mode` varchar(32) DEFAULT NULL COMMENT '汇总类型',
  `formula` text COMMENT '公式',
  `formula_comment` varchar(128) DEFAULT NULL COMMENT '公式描述',
  `calc_priority` int(11) DEFAULT NULL COMMENT '计算优先级',
  `type` varchar(64) NOT NULL COMMENT '指标类型: system/custom',
  `is_valid` int(11) DEFAULT NULL COMMENT '是否可用	',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `space_grit` varchar(255) DEFAULT NULL COMMENT '空间粒度',
  `indicator_assemble_id` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '指标集id',
  `source` varchar(255) DEFAULT NULL COMMENT '指标来源',
  `parent_id` int(20) DEFAULT NULL COMMENT '父id',
  `label` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '标签',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=463 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of omc_pm_indicator
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for omc_security_log
-- ----------------------------
DROP TABLE IF EXISTS `omc_security_log`;
CREATE TABLE `omc_security_log` (
  `id` int(64) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `exception_detail` text,
  `log_type` varchar(255) DEFAULT NULL,
  `method` varchar(255) DEFAULT NULL,
  `params` text,
  `request_ip` varchar(255) DEFAULT NULL,
  `time` bigint(20) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `status` varchar(32) DEFAULT NULL,
  `exception_name` text,
  `action` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '日志动作',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3336 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of omc_security_log
-- ----------------------------
BEGIN;
COMMIT;
